# This function converts a given string to an array of integers corresponding
# to the binary representation of the characters.
function string2binary(s)
    string_int_arr = [convert(Int64, a) for a in s];
    bin_string = [bin(a, 8) for a in string_int_arr];
    final_string = join(bin_string);
    final_arr = [2*parse(Int64, string(a))-1 for a in final_string];

    return final_arr
end

# This function converts a given array of integers (containing only ones and
# negative ones!) back to a string.
function binary2string(arr)
    chunked_arr = [round.(Int64, (arr[i:i+7]+1)/2) for i in 1:8:8*floor.(Int64, length(arr)/8)];
    chunked_str_arr = [join(a) for a in chunked_arr];
    final_string = join([convert(Char, parse(Int64, a, 2)) for a in chunked_str_arr]);

    return final_string
end

